import React, { Component } from "react";
import "./App.css";
import { DoctorLayout } from "./doctor_ui";
import { PatientLayout } from "./patient_ui";
import { AdminLayout } from "./admin_ui";
import { SignUp } from "./signup";
import { SignIn } from "./signin";
import { Home } from "./home";
import { Home2 } from "./home2";
//import { TestTable } from "./components/testtable";
import { Test } from "./test";
import { Test2 } from "./test2";
// import {Linker} from './components/link'
import { NavBar } from "./components/navbar";
import { Run } from "./run";
import { VitalsTable } from "./components/vitalstable";
import { AlertTable } from "./components/alerts";
import { Extract } from "./components/extract";
import {
  Route,
  Router,
  hashHistory,
  BrowserRouter,
  Switch,
} from "react-router-dom";
import { AdminExtract } from "./components/listextractor";
import { VitalsTable2 } from "./components/vitalstable2";
import axios from "axios";
import { PatTable } from "./components/pattable";
class App extends Component {
  constructor() {
    super();
    this.state = {
      data: [],
      v: "sex",
    };
  }

  //set url here
  url = "http://c53b8891d2d7.ngrok.io/";
  render() {
    return (
      <div className="App">
        {/* <BrowserRouter>
          <Route path="/" component={Home}>
          <Route path="/signin" component={SignIn}/>
          {/* <Home/> */}
        {/* <SignUp/> */}
        {/* <SignIn/> */}
        {/* <DoctorLayout/>  */}
        {/* <PatientLayout/> */}
        {/* <AdminLayout /> */}
        {/* <Home2 />   */}
        {/* <Linker /> */}
        {/* <VitalsTable2/> */}
        {/* <DoctorLayout/> */}
        {/* <PatientLayout/> */}
        {/*//Note for route vtials/userid we need to pass the id to the componenet also */}
        <BrowserRouter>
          <Route path="/" component={Home2} />
          <Route
            path={"/signin"}
            exact
            render={(props) => {
              return <SignIn {...props} url={this.url} />;
            }}
          />
          <Route
            path="/signup"
            exact
            render={(props) => {
              return <SignUp {...props} url={this.url} />;
            }}
          />
          {/* <Route path="/doctor/" exact component={DoctorLayout} /> */}
          <Route
            path="/doctor/:d_id"
            exact
            render={(props) => {
              return <DoctorLayout {...props} url={this.url} />;
            }}
          />
          {/* <Route path="/patient" exact component={PatientLayout} /> */}
          <Route
            path="/patient/:p_id"
            exact
            render={(props) => {
              return <PatientLayout {...props} url={this.url} />;
            }}
          />
          {/* <Route path="/admin" exact component={AdminLayout} /> */}
          <Route
            path="/admin/:a_id"
            exact
            render={(props) => {
              return <AdminLayout {...props} url={this.url} />;
            }}
          />
          <Route path="/vitals/:userid" exact component={VitalsTable2} />
          {/* <Route path="/vitals" exact component={VitalsTable2} /> */}
        </BrowserRouter>
        {/* <Extract /> */}
      </div>
    );
  }
}

export default App;
